class MainUI
{
    start()
    {
        let homeMenu = new HomeMenu();
        let hud = new HUDPanel();
        let menu = new MainMenu();
        let menuButton = new MainMenuButton();

        GameUI.addChild(new Output());
        GameUI.addChild(hud);
        GameUI.addChild(menu);
        GameUI.addChild(menuButton);
        GameUI.addChild(homeMenu);

        GameEvent.addEvent("Share", ()=>
        {
            FBInterface.share("Big shots are only little shots who keep shooting.\n - Christopher Morley", shareImage);
        })
    }
}

